import React from 'react'
import { Formik, Form } from 'formik';
import { Tect } from './TextField'

export const Login = () => {
    return (
        <Formik
        initialValues={{
            email: '',
            password: '',  
            }}
        >
            

            {formik => (
            <div>
            {console.log(formik)}
            <Form>
                <TextField />
            </Form>
            </div>    
            )}
        </Formik>
    )
}
